import React, { useState } from 'react'
import { PdfViewr } from './miniproject/PdfViewr'
import PdfUpload from './miniproject/PdfUploader';

 const App = () => {
  const [document,setDocument]=useState([]);
  const documentList=[
    { name: 'Document 1', fileName: 'document1.pdf' },
    { name: 'Document 2', fileName: 'document2.pdf' },
  ]
  const onselect=()=>{
    setDocument(documentList);
  }
  return (
    <>
      <PdfUpload documents={documentList} onselect={onselect}/>
      <PdfViewr doc={document}/>
    </>
  )
}
export default App;
